import React from "react";

function EventCard( { currentEvent } ) {
  // console.log(currentEvent.setup)
  // console.log()
  // const choices = currentEvent.choices.forEach(choice => console.log(choice))
  const choices = currentEvent.choices.map(choice => <div key={choice.selection[0]}><button>{choice.selection[0]}</button><span>{choice.selection}</span></div>)

  return (
    <div className="event-div">
      <p>{currentEvent.setup}</p>
      {choices}
    </div>
  )
}

export default EventCard
